INSERT INTO `soft_educ`.`modulo` VALUES  (2,'1','Que es el Software?','En una forma sencilla de decir, el software es la parte intangible del computador. En una forma más técnica es el equipamiento lógico o soporte lógico de una computadora digital; comprende el conjunto de los componentes lógicos necesarios que hacen posible la realización de tareas específicas, a diferencia de los componentes físicos, que son llamados hardware.<br><br>\r\nTipos de Software:<br>\r\nSoftware de sistema: Su objetivo es desvincular adecuadamente al usuario y al programador de los detalles de la computadora en particular que se use, aislándolo especialmente del procesamiento referido a las características internas de: memoria, discos, puertos y dispositivos de comunicaciones, impresoras, pantallas, teclados, etc. El software de sistema le procura al usuario y programador adecuadas interfaces de alto nivel, herramientas y utilidades de apoyo que permiten su mantenimiento. Incluye entre otros:<br><br>\r\n<ul>\r\n<li>Sistemas operativos</li>\r\n<li>Controladores de dispositivos</li>\r\n<li>Herramientas de diagnóstico</li>\r\n<li>Herramientas de Corrección y Optimización</li>\r\n<li>Servidores</li>\r\n<li>Utilidades</li>\r\n</ul>\r\nSoftware de programación: Es el conjunto de herramientas que permiten al programador desarrollar programas informáticos, usando diferentes alternativas y lenguajes de programación, de una manera práctica. Incluye entre otros:<br>\r\n<ul>\r\n<li>Editores de texto</li>\r\n<li>Compiladores</li>\r\n<li>Intérpretes</li>\r\n<li>Enlazadores</li>\r\n<li>Depuradores</li>\r\n<li>Entornos de Desarrollo Integrados (IDE): Agrupan las anteriores herramientas, usualmente en un entorno visual, de forma tal que el programador no necesite introducir múltiples comandos para compilar, interpretar, depurar, etc. Habitualmente cuentan con una avanzada interfaz gráfica de usuario (GUI).</li>\r\n</ul>\r\nSoftware de aplicación: Es aquel que permite a los usuarios llevar a cabo una o varias tareas específicas, en cualquier campo de actividad susceptible de ser automatizado o asistido, con especial énfasis en los negocios. Incluye entre otros:<br>\r\n<ul>\r\n<li>Aplicaciones para Control de sistemas y automatización industrial</li>\r\n<li>Aplicaciones ofimáticas</li>\r\n<li>Software educativo</li>\r\n<li>Software empresarial</li>\r\n<li>Bases de datos</li>\r\n<li>Telecomunicaciones (por ejemplo Internet y toda su estructura lógica)</li>\r\n<li>Videojuegos</li>\r\n<li>Software médico</li>\r\n<li>Software de Cálculo Numérico y simbólico.</li>\r\n<li>Software de Diseño Asistido (CAD)</li>\r\n<li>Software de Control Numérico (CAM)</li>\r\n</ul>',,'image/png','2011-03-26','2011-05-06'),
 (3,'2','Software Libre','El software libre es un tipo de paradigma donde se comparte el código fuente, primero debemos saber que es el \"código fuente\".<br><br>\r\nEl código fuente es lo que los programadores generan en diversos lenguajes de programación para llegar a un producto terminado o software.<br><br>\r\nEl software libre suele confundirse con \"gratis\" ya que en ingles el término \"free\" significa libre y a demás gratis.<br><br>\r\nEL software libre basa el paradigma en cuatro libertades:<br>\r\n0. La libertad de usar el programa, con cualquier propósito.<br>\r\n1. La libertad de estudiar cómo funciona el programa y modificarlo, adaptándolo a tus necesidades.<br>\r\n2. La libertad de distribuir copias del programa, con lo cual puedes ayudar a tu prójimo.<br>\r\n3. La libertad de mejorar el programa y hacer públicas esas mejoras a los demás, de modo que toda la comunidad se beneficie.<br><br>\r\n\r\nPor otra parte el Software Libre tiene distintas licencias, entre ellas encontramos:<br>\r\n\r\nLicencias GPL(Licencia Pública General)<br>\r\nLicencia AGPL(Licencia Pública General de Affero)<br>\r\nLicencias BSD(Berkeley Software Distribution)<br>\r\nLicencias MPL(Mozilla Public License)<br>\r\n',,'image/png','2011-03-26','2011-05-07');
INSERT INTO `soft_educ`.`modulo` VALUES  (5,'3','GNU/Linux','GNU/Linux es uno de los términos empleados para referirse a la combinación del núcleo o kernel libre similar a Unix denominado Linux, que es usado con herramientas de sistema GNU. Su desarrollo es uno de los ejemplos más prominentes de software libre; todo su código fuente puede ser utilizado, modificado y redistribuido libremente por cualquiera bajo los términos de la GPL (Licencia Pública General de GNU, en inglés: General Public License) y otra serie de licencias libres.<br><br>\r\nA pesar de que Linux (núcleo) es, en sentido estricto, el sistema operativo, parte fundamental de la interacción entre el núcleo y el usuario (o los programas de aplicación) se maneja usualmente con las herramientas del proyecto GNU o de otros proyectos como GNOME. Sin embargo, una parte significativa de la comunidad, así como muchos medios generales y especializados, prefieren utilizar el término Linux para referirse a la unión de ambos proyectos. Para más información consulte la sección \"Denominación GNU/Linux\" o el artículo \"Controversia por la denominación GNU/Linux\".<br><br>\r\nA las variantes de esta unión de programas y tecnologías, a las que se les adicionan diversos programas de aplicación de propósitos específicos o generales se las denomina distribuciones. Su objetivo consiste en ofrecer ediciones que cumplan con las necesidades de un determinado grupo de usuarios. Algunas de ellas son especialmente conocidas por su uso en servidores y supercomputadoras. donde tiene la cuota mas importante del mercado. Según un informe de IDC, GNU/Linux es utilizado por el 78% de los principales 500 servidores del mundo, otro informe le da una cuota de mercado de 89% en los 500 mayores supercomputadores. Con menor cuota de mercado el sistema GNU/Linux también es usado en el segmento de las computadoras de escritorio, portátiles, computadoras de bolsillo, teléfonos móviles, sistemas embebidos, videoconsolas y otros dispositivos.\r\n',,'image/jpeg','2011-05-07','2011-05-07'),
 (6,'4','titulo del modulo 4','jjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjj',,'image/gif','2011-05-19','2011-05-19');
